import About from "./Components/About";
import Child from "./Components/About/Child";
import Cal from "./Components/Contact/Cal";
import Contact from "./Components/Contact/Contact";
import Service from "./Components/Contact/Service";
import Home from "./Components/Home";





function App() {
  const clickbutton=(btn)=>{
    console.log("je suis un composant");
  }


  return (
    <div className="App">
      <p>projet react</p>
      <Home></Home>
      <Contact></Contact>
      <Service />
      <About name={'Houda'} age={25} />

      <Cal nbr1={30}  nbr2={10}/>
      <Child btn={clickbutton}/>



    </div>
  );
}

export default App;
